%D0%9F%D0%B5%D1%82%D1%80%D0%B0%D1%88%D0%B5%D0%B2%D1%86%D1%8B\" title=\"\u041f\u0435\u0442\u0440\u0430\u0448\u0435\u0432\u0446\u044b\">\u043f\u0435\u0442\u0440\u0430\u0448\u0435\u0432\u0446\u0430\u043c<\/a>, \u0432\u043a\u043b\u044e\u0447\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D1%81%D1%82%D0%BE%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%A4%D1%91%D0%B4%D0%BE%D1%80_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0414\u043e\u0441\u0442\u043e\u0435\u0432\u0441\u043a\u0438\u0439, \u0424\u0451\u0434\u043e\u0440 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447\">\u0424.&#160;\u041c.&#160;\u0414\u043e\u0441\u0442\u043e\u0435\u0432\u0441\u043a\u043e\u0433\u043e<\/a>, \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d\u043e \u043e \u043f\u043e\u043c\u0438\u043b\u043e\u0432\u0430\u043d\u0438\u0438 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1878_%D0%B3%D0%BE%D0%B4\" title=\"1878 \u0433\u043e\u0434\">1878<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%BE-%D1%82%D1%83%D1%80%D0%B5%D1%86%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1877%E2%80%941878)\" title=\"\u0420\u0443\u0441\u0441\u043a\u043e-\u0442\u0443\u0440\u0435\u0446\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1877\u20141878)\">\u0420\u0443\u0441\u0441\u043a\u043e-\u0442\u0443\u0440\u0435\u0446\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 1877\u20141878<\/a>: <a href=\"https:\/\/bg.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%BF%D0%B0%D0%B4%D0%B5%D0%BD_%D0%BE%D1%82%D1%80%D1%8F%D0%B4_%D0%BD%D0%B0_%D0%93%D1%83%D1%80%D0%BA%D0%BE\" class=\"extiw\" title=\"bg:\u0417\u0430\u043f\u0430\u0434\u0435\u043d \u043e\u0442\u0440\u044f\u0434 \u043d\u0430 \u0413\u0443\u0440\u043a\u043e\">\u043e\u0442\u0440\u044f\u0434<\/a> \u0433\u0435\u043d\u0435\u0440\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%83%D1%80%D0%BA%D0%BE,_%D0%98%D0%BE%D1%81%D0%B8%D1%84_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0413\u0443\u0440\u043a\u043e, \u0418\u043e\u0441\u0438\u0444 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\">\u0418.&#160;\u0412.&#160;\u0413\u0443\u0440\u043a\u043e<\/a> \u0432 \u0438\u0441\u043a\u043b\u044e\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u0442\u0440\u0443\u0434\u043d\u044b\u0445 \u0443\u0441\u043b\u043e\u0432\u0438\u044f\u0445 \u043f\u0435\u0440\u0435\u0448\u0451\u043b \u0447\u0435\u0440\u0435\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BB%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D0%BB%D1%83%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2\" title=\"\u0411\u0430\u043b\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u043f\u043e\u043b\u0443\u043e\u0441\u0442\u0440\u043e\u0432\">\u0411\u0430\u043b\u043a\u0430\u043d\u044b<\/a> \u0438 \u0437\u0430\u043d\u044f\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%84%D0%B8%D1%8F\" title=\"\u0421\u043e\u0444\u0438\u044f\">\u0421\u043e\u0444\u0438\u044e<\/a>, <a href=\"https:\/\/bg.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%BA%D0%B0_%D0%BF%D1%80%D0%B8_%D0%A1%D0%BE%D1%84%D0%B8%D1%8F\" class=\"extiw\" title=\"bg:\u0411\u0438\u0442\u043a\u0430 \u043f\u0440\u0438 \u0421\u043e\u0444\u0438\u044f\">\u043e\u0441\u0432\u043e\u0431\u043e\u0434\u0438\u0432 \u0435\u0451<\/a> \u043e\u0442 \u0442\u0443\u0440\u0435\u0446\u043a\u043e\u0433\u043e \u0432\u043b\u0430\u0434\u044b\u0447\u0435\u0441\u0442\u0432\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1896_%D0%B3%D0%BE%D0%B4\" title=\"1896 \u0433\u043e\u0434\">1896<\/a>&#160;\u2014 45-\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B4%D0%BC%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%BE%D0%B5_%D0%B4%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5_%D0%A1%D0%A8%D0%90\" title=\"\u0410\u0434\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043d\u043e\u0435 \u0434\u0435\u043b\u0435\u043d\u0438\u0435 \u0421\u0428\u0