/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%80%D1%8B%D0%BA%D0%B0%D0%BC%D1%8B%D1%88%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u0421\u0430\u0440\u044b\u043a\u0430\u043c\u044b\u0448\u0441\u043a\u043e\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435\">\u0421\u0430\u0440\u044b\u043a\u0430\u043c\u044b\u0448\u0441\u043a\u043e\u0439 \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u0438<\/a> \u0440\u0443\u0441\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u0432\u0437\u044f\u043b\u0438 \u0432 \u043f\u043b\u0435\u043d \u0432\u0435\u0441\u044c 9-\u0439 \u0442\u0443\u0440\u0435\u0446\u043a\u0438\u0439 \u043a\u043e\u0440\u043f\u0443\u0441.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%B9%D1%85%D0%B3%D0%BE%D1%80%D0%BD,_%D0%AD%D0%BC%D0%B8%D0%BB%D1%8C\" title=\"\u042d\u0439\u0445\u0433\u043e\u0440\u043d, \u042d\u043c\u0438\u043b\u044c\">\u042d\u043c\u0438\u043b\u044c \u042d\u0439\u0445\u0433\u043e\u0440\u043d<\/a> \u043e\u0442\u0441\u0442\u0440\u0430\u043d\u0451\u043d \u043e\u0442 \u0434\u043e\u043b\u0436\u043d\u043e\u0441\u0442\u0438 \u043f\u043e\u043b\u0438\u0446\u0430\u0439-\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD\" title=\"\u0411\u0435\u0440\u043b\u0438\u043d\">\u0411\u0435\u0440\u043b\u0438\u043d\u0430<\/a>, \u0447\u0442\u043e \u0441\u043f\u0440\u043e\u0432\u043e\u0446\u0438\u0440\u043e\u0432\u0430\u043b\u043e \u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u044b\u0435 \u0441\u0442\u043e\u043b\u043a\u043d\u043e\u0432\u0435\u043d\u0438\u044f \u0440\u0430\u0431\u043e\u0447\u0438\u0445 \u0441 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 (\u00ab\u042f\u043d\u0432\u0430\u0440\u0441\u043a\u0438\u0435 \u0431\u043e\u0438 1919\u00bb).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5\" title=\"\u0412\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435\">\u0412\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435<\/a> \u0438 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BB%D0%B0%D1%81%D1%82%D1%8C\" class=\"mw-redirect\" title=\"\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u0432\u043b\u0430\u0441\u0442\u044c\">\u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u0432\u043b\u0430\u0441\u0442\u0438<\/a> (\u0441\u043c. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%BE%D1%8F%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u041a\u0440\u0430\u0441\u043d\u043e\u044f\u0440\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f\">\u041a\u0440\u0430\u0441\u043d\u043e\u044f\u0440\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D1%87%D0%B0%D0%BA,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041a\u043e\u043b\u0447\u0430\u043a, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u041a\u043e\u043b\u0447\u0430\u043a<\/a> \u0431\u044b\u043b \u043b\u0438\u0448\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D