iki\/%D0%9B%D0%B8%D0%BA%D0%B1%D0%B5%D0%B7\" title=\"\u041b\u0438\u043a\u0431\u0435\u0437\">\u0431\u043e\u0440\u044c\u0431\u0443 \u0441 \u043d\u0435\u0433\u0440\u0430\u043c\u043e\u0442\u043d\u043e\u0441\u0442\u044c\u044e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1927_%D0%B3%D0%BE%D0%B4\" title=\"1927 \u0433\u043e\u0434\">1927<\/a>&#160;\u2014 \u041b\u0438\u0434\u0435\u0440\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%92%D1%81%D0%B5%D0%BE%D0%B1%D1%89%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BD%D1%84%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%D1%82%D1%80%D1%83%D0%B4%D0%B0_%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D0%B8&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0412\u0441\u0435\u043e\u0431\u0449\u0430\u044f \u043a\u043e\u043d\u0444\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u044f \u0442\u0440\u0443\u0434\u0430 \u0418\u0442\u0430\u043b\u0438\u0438 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0412\u0441\u0435\u043e\u0431\u0449\u0435\u0439 \u043a\u043e\u043d\u0444\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438 \u0442\u0440\u0443\u0434\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u0438<\/a> \u0431\u044b\u043b\u043e \u043f\u0440\u0438\u043d\u044f\u0442\u043e \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u043e \u0435\u0451 \u0441\u0430\u043c\u043e\u0440\u043e\u0441\u043f\u0443\u0441\u043a\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942_%D0%B3%D0%BE%D0%B4\" title=\"1942 \u0433\u043e\u0434\">1942<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D1%80%D0%BE%D0%BD%D0%B8%D0%BA%D0%B0_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B9_%D0%9E%D1%82%D0%B5%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%BE%D0%B9_%D0%B2%D0%BE%D0%B9%D0%BD%D1%8B\/%D0%AF%D0%BD%D0%B2%D0%B0%D1%80%D1%8C_1942_%D0%B3%D0%BE%D0%B4%D0%B0#4